declare @ExpiryDate   datetime      = '2023-09-27 21:32:00.000'
declare @ModifiedDate datetime      = getdate()
declare @ModifiedBy   nvarchar(200) = 'sysadmin'

begin tran

  insert DashboardNotificationPool
         (  NotificationTypeID, GenerationDate,  Message,  OverrideColor, ClickUrl, Feedback,  ExpiryDate, Active,  ModifiedDate,  ModifiedBy)    
  values ( @NotificationTypeID,  @ModifiedDate, @Message, @OverrideColor, null    , null    , @ExpiryDate, 1     , @ModifiedDate, @ModifiedBy)    
  
  declare @NotificationID int = (select NotificationID from DashboardNotificationPool where ModifiedBy = @ModifiedBy and ModifiedDate = @ModifiedDate)    
  
  insert DashboardNotificationPoolUser
         (  DomainID,  NotificationID, UserID,  ClientAdminOnly,  ModifiedDate,  ModifiedBy)    
  values ( @DomainID, @NotificationID, null  , @ClientAdminOnly, @ModifiedDate, @ModifiedBy)
  
  select * from DashboardNotificationPool     where NotificationID = @NotificationID
  select * from DashboardNotificationPoolUser where NotificationID = @NotificationID

rollback tran